export default function Consultation() {
    return (
        <Container>
            <h2 className='text-bold text-color-pink mt-5'>Consultation</h2>
            <Card style={{ boxShadow: "0 0 10px gray" }} className='mb-5'>
                <Card.Body className='mt-4'>
                </Card.Body>
            </Card>
        </Container>
    )
}
